  \"Morpheus Vertical Test Bed (VTB)/Autonomous Landing and Hazard Avoidance Technology
  (ALHAT) Project\",\n\t\"tracking_summary\": {\n\t\t\"total\": 8,\n\t\t\"recent\":
  1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\":
  \"2015-05-07T01:31:41.132838\",\n\t\"name\": \"morpheus-vertical-test-bed-vtb-autonomous-landing-and-hazard-avoidance-technology-alhat-pr\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"&lt;p&gt;The Morpheus VTB/ALHAT project
  plans to free fly a reusable Morpheus VTB with the integrated ALHAT system starting
  from a slant range of approximately 500 m to the landing target at the KSC Shuttle
  Landing Field (SLF), ascending to about 250 m and descending to a safe landing site,
  and demonstrating an autonomous closed loop landing. This flight will demonstrate
  real-time hazard detection and hazard avoidance followed by a divert maneuver to
  the determined safe landing aim point and a safe, controlled landing within a hazard
  field. This demonstration flight will be a culmination of a series of earlier test
  flights, starting with improvements to the LOx-Methane propulsion system, GPS navigation,
  integrated reaction control system, and incrementally increasing in complexity by
  incorporating ALHAT sensor data.&amp;nbsp; The project aims to yield not just technologies,
  but technologies integrated as capabilities which could then be easily adapted to
  human spaceflight mission architectures.&lt;/p&gt;\",\n\t\"license_title\": \"U.S.
